import React from 'react';

export default (props:any) => {
    return (
        <div style={{
            width: '200px',
            margin: '0 auto',
        }}>
            <h3>{ props.value }</h3>
            <button onClick={props.addValue}>Плюс 1</button>
            <button>Минус 1</button>
        </div>
    )
}
